import React from 'react';
import {
   Link
 } from "react-router-dom";
const navLinks = [
    {
        title: 'Home',
        path: '/'
    },
    {
        title: 'Blog',
        path: '/blog'
    },
    {
        title:'Contact',
        path:'/contact'
    },
    {
        title:'Shop',
        path:'/shop'
    },
    {
        title:'Login',
        path:'/login'
    },
    {   title:'Create',
        path: '/create'
    }
        
]

export default function Navigation () {

    return (<nav className = "site-navigation">
        <span class = 'site-title'>SPIRIT</span>
        <ul class = 'nav-options'>
            { navLinks.map((link,index) => (
                <li key={index}>
                    <Link to={link.path}>{link.title} </Link>
                </li>

            ))}
        </ul>

    </nav>)
}
